package Arrays;

public class SimpleArrayex {
	public static void display(int[] array)
	{
		for(int num:array)
		{
			System.out.println(num);
		}
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		int[] num=new int[] {2,3,4,9,5};
		display(num);
		
	}

}
